import * as React from "react";
import {
  Box,
  FormControl,
  InputLabel,
  MenuItem,
  Select,
  TextField,
  Typography,
  Button,
  Stack,
  Grid,
} from "@mui/material";
import { useState } from "react";
import Dropzone from "react-dropzone";
import md5 from "md5";
import { Theme } from "../others/Theme";

export const CreateProduct = () => {
  const [name, setName] = useState();
  const [file, setFile] = useState();
  const [blockchain, setBlockchain] = useState();
  const [itemTag, setItemTag] = useState();
  const [externalLink, setExternalLink] = useState();
  const [quantity, setQuantity] = useState();
  const [ItemObject, setItemObject] = useState();
  const [description, setDescription] = useState();

  const addItem = (event) => {
    event.preventDefault();
    setItemObject({
      name,
      id: md5(name),
      file,
      blockchain,
      tag: itemTag,
      externalLink,
      quantity,
      description,
    });
  };
  console.log(ItemObject);

  return (
    <>
      <Box
        sx={{
          bgcolor: Theme.palette.primary.light,
          boxShadow: 1,
          borderRadius: 5,
          p: 2,
          m: 1,
          mt: 3,
          ml: 2,
          mr: 2,
          mb: 2,
          pb: 8,
        }}
      >
        <Dropzone onDrop={(file) => setFile(file)}>
          {({ getRootProps, getInputProps }) => (
            <section style={{ border: "2px solid black" }}>
              <div {...getRootProps()}>
                <input {...getInputProps()} />
                <p>Drag 'n' drop some files here, or click to select files</p>
              </div>
            </section>
          )}
        </Dropzone>
      </Box>
      <Box sx={{ width: "100%" }}>
        <Stack direction="row" spacing={2}>
          <Grid container spacing={3}>
            <Grid xs>
              <Box
                sx={{
                  bgcolor: "#EBDEF0",
                  boxShadow: 1,
                  borderRadius: 5,
                  p: 2,
                  m: 3,
                }}
              >
                <TextField
                  label="Name"
                  error={!name && "Name is empty"}
                  helperText={!name && "Please"}
                  value={name}
                  onChange={(e) => setName(e.target.value)}
                />
              </Box>
            </Grid>
            <Grid xs>
              <Box
                sx={{
                  bgcolor: "#FCF3CF",
                  boxShadow: 1,
                  borderRadius: 5,
                  p: 2,
                  m: 3,
                }}
              >
                <TextField
                  label="External Link"
                  value={externalLink}
                  onChange={(e) => setExternalLink(e.target.value)}
                />
              </Box>
            </Grid>
            <Grid >
              <Box
                sx={{
                  bgcolor: "#EBDEF0",
                  boxShadow: 1,
                  borderRadius: 5,
                  p: 2,
                  m: 3,
                }}
              >
                <TextField
                  label="Quantity"
                  value={quantity}
                  onChange={(e) => setQuantity(e.target.value)}
                />
              </Box>
            </Grid>
          </Grid>

          <Grid container spacing={3}>
            <Grid xs={14} md={9}>
              <Box
                sx={{
                  bgcolor: "#FCF3CF",
                  boxShadow: 1,
                  borderRadius: 5,
                  p: 2,
                }}
              >
                <Typography>select tag</Typography>
                <FormControl sx={{ m: 1, minWidth: 120 }}>
                  <InputLabel>blockchain</InputLabel>
                  <Select
                    value={blockchain}
                    label="Tag"
                    onChange={(e) => setBlockchain(e.target.value)}
                  >
                    <MenuItem value="">
                      <em>None</em>
                    </MenuItem>
                    <MenuItem value={1}>blockchain1</MenuItem>
                    <MenuItem value={2}>blockchain2</MenuItem>
                    <MenuItem value={3}>blockchain3</MenuItem>
                  </Select>
                </FormControl>
              </Box>
            </Grid>
            <Grid xs={14} md={9}>
              <Box
                sx={{
                  bgcolor: "#EBDEF0",
                  boxShadow: 1,
                  borderRadius: 5,
                  p: 2,
                }}
              >
                <Typography>select tag😈</Typography>
                <FormControl sx={{ m: 1, minWidth: 120 }}>
                  <InputLabel>Tag</InputLabel>
                  <Select
                    value={itemTag}
                    label="Tag"
                    onChange={(e) => setItemTag(e.target.value)}
                  >
                    <MenuItem value="">
                      <em>None</em>
                    </MenuItem>
                    <MenuItem value={1}>Art</MenuItem>
                    <MenuItem value={2}>Music</MenuItem>
                    <MenuItem value={3}>Photo</MenuItem>
                  </Select>
                </FormControl>
              </Box>
            </Grid>
          </Grid>
        </Stack>
      </Box>
      <Box
        sx={{
          bgcolor: "#FCF3CF",
          boxShadow: 1,
          borderRadius: 5,
          p: 3,
          m: 3,
        }}
      >
        <TextField
          label="Description"
          value={description}
          onChange={(e) => setDescription(e.target.value)}
        />
      </Box>
      <Box>
        <Button
          sx={{
            backgroundColor: "#7D3C98",
            color: "#888",
            "&:hover": {
              backgroundColor: "#5B2C6F",
            },
          }}
          variant="contained"
          onClick={addItem}
        >
          create
        </Button>
      </Box>
    </>
  );
};
